import React from 'react';
import { NavLink } from 'react-router-dom';
import CN from 'classnames';

export const Wrapper = ({ children }) => (
	<section className="w-80 center mv4 flex justify-between flex-wrap">
		{children}
	</section>
);

export const Main = ({ children }) => (
	<section className="w-80 center mv4 flex">{children}</section>
);

export const Card = ({ back, title, to, color }) => (
	<NavLink
		to={to}
		className="mb3 flex items-center justify-center w-32 h7 hover-bg-white bg-black"
	>
		<div className={CN('absolute pa3 futura ttu fw7 f1 z-max', color)}>
			{title}
		</div>

		<img src={back} alt="prj" className="obj-card z-2" />
	</NavLink>
);

export const DoubleCard = ({ back, title, to, color }) => (
	<NavLink
		to={to}
		className="mb3 flex items-center justify-center w-64 h7 hover-bg-white bg-black"
	>
		<div className={CN('absolute pa3 futura ttu fw7 f1 z-max', color)}>
			{title}
		</div>

		<img src={back} alt="prj" className="obj-card z-2" />
	</NavLink>
);
